using namespace std;

class Solution {
public:
    long long minimumCost(vector<int>& nums) {
        sort(nums.begin(), nums.end());
        int acc = accumulate(nums.begin(), nums.end(), 0);
        int brk = acc / nums.size();
        int up = brk, low = brk;
        while (!isp(up)) up++;
        while (!isp(low)) low--;

        long long dup = absdiff(nums, up++);
        long long pdup = dup;
        while (true) {
            while (!isp(up)) up++;
            dup = absdiff(nums, up++);
            if (dup > pdup) {
                dup = pdup;
                break;
            }
            else {
                pdup = dup;
            }
        }
        long long dlow = absdiff(nums, low--);
        long long pdlow = dlow;
        while (true) {
            while (!isp(low)) low--;
            dlow = absdiff(nums, low--);
            if (dlow > pdlow) {
                dlow = pdlow;
                break;
            }
            else {
                pdlow = dlow;
            }
        }
        return min(dlow, dup);
        
    }
    bool isp(int n) {
        vector<int> v;
        while (n) {
            v.push_back(n%10);
            n /= 10;
        }
        bool flag = true;
        if (v.size() > 0) {
            for(int i = 0, j = v.size() - 1; i <= j; i++, j--) {
                if (v[i] != v[j]) {
                    flag = false;
                    break;
                }
            }
        }
        return flag;
    }
    long long absdiff(vector<int>& nums, int target) {
        long long rtn = 0;
        for(int i = 0; i < nums.size(); i++) {
            rtn += abs(target - nums[i]);
        }
        return rtn;
    }
};

